import React, { Component } from 'react'

export class Item extends Component {
   
  render() 
  { if (!this.props.myArray) {
    return <div>Loading...</div>;
  }
    return (
      <div>
        <ul>
        {this.props.myArray?.map((item) => (
          <li key={item}>{item + 10}</li>
        ))}
      </ul>
      </div>
    )
  }
}

export default Item
